description:
This is a re-muxed version of the first Episode of the unofficial Touhou Project anime, made by MaiKaze and subbed by various groups.

I took a raw, HQ video &amp; audio rip and added all subtitles I could find as well as some file details from other releases to create a MultiSub HQ re-release for anyone who is interested.


All credit for making this possible goes to these groups:

MaiKaze - For managing to bring this nice anime to a great game series into the world.
StrikeS-Ayako - Main English FanSub (Fancy)
KAGUYA - Alternative English FanSub (Simple)
#a-radio - English JokeSub
AnK - Italian FanSub
Kuroyami&amp;E-HARO - Russian FanSub
XOP - Valencian / Catalan / Spanish FanSub
ZUN - Creating the Touhou Project

Unknown - For uploading a nice HQ rip somewhere on the net.



